const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Azure Private Link for Azure Cache for Redis provides private connectivity from a virtual network to your cache instance. This means that you can now use Azure Private Link to connect to an Azure Cache for Redis instance from your virtual network via a private endpoint, which is assigned a private IP address in a subnet within the virtual network.It simplifies the network architecture and secures the connection between endpoints in Azure by eliminating data exposure to the public internet. Private Link carries traffic privately, reducing your exposure to threats and helps you meet compliance standards.`}</p>
    <p>{`Azure Resource Manager(a.k.a AzureRM) is the deployment and management service for Azure. It provides a management layer that enables you to create, update, and delete resources in your Azure account. You can use management features, like access control, locks, and tags, to secure and organize your resources after deployment. The "azurerm_redis_enterprise_cluster" is a resource that manages a Redis Enterprise cluster. This is a template to get started with the 'azurerm_redis_enterprise_cluster' resource available in the 'azurerm' provider with Terraform.`}</p>
    <h3 {...{
      "id": "prerequisite"
    }}>{`Prerequisite`}</h3>
    <ol>
      <li parentName="ol"><a parentName="li" {...{
          "href": "https://terraform.io"
        }}>{`Terraform`}</a></li>
      <li parentName="ol"><a parentName="li" {...{
          "href": "https://docs.microsoft.com/en-us/cli/azure/install-azure-cli"
        }}>{`Azure CLI`}</a></li>
    </ol>
    <h3 {...{
      "id": "step-1-getting-started"
    }}>{`Step 1. Getting Started`}</h3>
    <p>{`Login in Azure using the Azure CLI`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`az login
`}</code></pre>
    <blockquote>
      <p parentName="blockquote">{`Login with a Service Principal will also work`}</p>
    </blockquote>
    <p>{`Login using an Azure Service Principal`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`az login --service-principal --username APP_ID --tenant TENANT_ID --password [password || /path/to/cert]
`}</code></pre>
    <h3 {...{
      "id": "step-2-clone-the-repository"
    }}>{`Step 2: Clone the repository`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`git clone https://github.com/redis-developer/acre-terraform
`}</code></pre>
    <h3 {...{
      "id": "step-3-initialize-the-repository"
    }}>{`Step 3: Initialize the repository`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`cd acre-terraform
terraform init
`}</code></pre>
    <blockquote>
      <p parentName="blockquote">{`The output should include: `}<inlineCode parentName="p">{`Terraform has been successfully initialized`}</inlineCode></p>
    </blockquote>
    <h3 {...{
      "id": "step-4-modify-the-variablesoptional"
    }}>{`Step 4: Modify the variables(optional)`}</h3>
    <p>{`The default variables are setup to deploy the smallest 'E10' instance into the 'East US' region.
Changes can be made by updating the `}<inlineCode parentName="p">{`variables.tf`}</inlineCode>{` file.`}</p>
    <h3 {...{
      "id": "step-5-verify-the-plan"
    }}>{`Step 5: Verify the plan`}</h3>
    <p>{`The 'plan' output will show you everything being created by the template.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`terraform plan
`}</code></pre>
    <blockquote>
      <p parentName="blockquote">{`The output should include: `}<inlineCode parentName="p">{`Plan: 18 to add, 0 to change, 0 to destroy.`}</inlineCode></p>
    </blockquote>
    <h3 {...{
      "id": "step-6-apply-the-plan"
    }}>{`Step 6: Apply the plan`}</h3>
    <p>{`When the plan looks good, 'apply' the template.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`terraform apply
`}</code></pre>
    <blockquote>
      <p parentName="blockquote">{`The output should include: `}<inlineCode parentName="p">{`Apply complete! Resources: 18 added, 0 changed, 0 destroyed.`}</inlineCode></p>
    </blockquote>
    <h3 {...{
      "id": "step-7-connect-using-generated-output"
    }}>{`Step 7: Connect using generated output`}</h3>
    <p>{`The access key is sensitive, so viewing the outputs must be requested specifically.
The output is also in JSON format.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`terraform output redisgeek_config
`}</code></pre>
    <blockquote>
      <p parentName="blockquote">{`Example output:`}</p>
      <pre parentName="blockquote"><code parentName="pre" {...{}}>{`{
"hostname" = "redisgeek-8jy4.eastus.redisenterprise.cache.azure.net"
"access_key" = "DQYABC3uRMXXXXXXXXXXXXXXXXTRkfgOXXXPjs82Y="
"port" = "10000"
}
`}</code></pre>
    </blockquote>
    <h3 {...{
      "id": "resources"
    }}>{`Resources`}</h3>
    <h5 {...{
      "id": "1-how-to-use-redis-cache-for-redis-like-a-pro"
    }}>{`1. How to use Redis Cache for Redis like a Pro`}</h5>
    <div class="text--center">
    <iframe width="760" height="415" src="https://www.youtube.com/embed/eThj-jwViZw" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <h5 {...{
      "id": "2-do-more-with-azure-cache-for-redis-enterprise-tiers"
    }}>{`2. Do More with Azure Cache for Redis, Enterprise Tiers`}</h5>
    <div class="text--center">
   <iframe width="760" height="415" src="https://www.youtube.com/embed/t6XQHsKFMKQ" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://azuremarketplace.microsoft.com/en-us/marketplace/apps/garantiadata.redis_enterprise_1sp_public_preview?ocid=redisga_redislabs_cloudpartner_cta1"
        }}>{`Azure Cache for Redis Enterprise`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://query.prod.cms.rt.microsoft.com/cms/api/am/binary/RWGGx3"
        }}>{`Accelerate Modern Application Delivery with Redis Enterprise on Microsoft Azure`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/develop/dotnet/"
        }}>{`.Net and Redis`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://docs.microsoft.com/en-us/azure/azure-cache-for-redis/quickstart-create-redis-enterprise"
        }}>{`Quickstart: Create a Redis Enterprise cache`}</a></li>
    </ul>
    </MDXLayout>;
}

